import React from "react";


export default function Login(){
    return (
        <div>
            <form action="#">
                <input type="text" placeholder="Enter email" name="email"/>
                <br/>
                <input type="password" placeholder="Password" name="password" />
                <br/>
                <button>Login</button>
            </form>
        </div>
    )
}
